    false,nt"url": null,nt"notes": "The U.S. Fish and Wildlife Service (Service)
    has recognized the need for a comprehensivehatchery planning process to assist in
    meeting the challenge of changes to hatcherymanagement as required by the conservation
    status of most Pacific salmon and otheranadromous and freshwater fish species. The
    development of plans, such as this one, willhelp to:1) integrate Service objectives
    and priorities with those of co-managers, other agencies, andresource programs;2)
    fulfill our obligations under the Endangered Species Act and relevant fisheriesconservation,
    mitigation, and management programs;3) identify and define hatchery reforms we are
    implementing to achieve our objectives; and,4) provide a foundation for future program
    and budget development and review.This plan recognizes and complies with all management
    plans and Biological Opinionsaffecting the Columbia River Basin.",nt"license_title":
